#include <ut/string.hpp>
using namespace ut;

void rlImGuiAddLucideIcons(float size)
{
    ImFontConfig font_config;
    font_config.MergeMode = true;
    font_config.PixelSnapH = true;
    font_config.OversampleH = 5;
    font_config.OversampleV = 5;
    font_config.FontDataOwnedByAtlas = false;
    font_config.GlyphOffset = ImVec2{0,2};

    static const ImWchar ranges[] = { ICON_MIN_LC, ICON_MAX_LC, 0, };

    cstrview("Lucide Icons").strncpy(font_config.Name, IM_ARRAYSIZE(font_config.Name));

    auto& io = ImGui::GetIO();

    auto f = io.Fonts->AddFontFromMemoryCompressedTTF(
        lucide_compressed_data,
        lucide_compressed_size,
        size, &font_config, ranges);

    io.FontDefault = f;
}